import React from 'react'
import logoo from '../assets/Logo.svg'
import { Link } from 'react-router-dom'

 const Navbar = () => {
  return (
    <div>
        <Link to="/">
            <img src={logoo} width={160} height={32}/>
        </Link>
    </div>
  )
}
export default Navbar;
